// src/App.jsx
import React from 'react';
import Footer from './Footer'; // Make sure the path is correct

const App = () => {
  return (
    <div>
      <header style={{ textAlign: 'center', padding: '20px' }}>
        <h1>Welcome to My To-Do List App</h1>
      </header>
      
      {/* Main content */}
      <main style={{ padding: '20px' }}>
        <p>Manage your tasks and stay productive!</p>
        {/* Other components for the To-Do List can be added here */}
      </main>
      
      {/* Footer */}
      <Footer />
    </div>
  );
};

export default App;
